DROP TABLE IF EXISTS "api_assetlog" CASCADE;
CREATE TABLE "api_assetlog" (
  "asset_log_id" int NOT NULL GENERATED BY DEFAULT AS IDENTITY,
  "log_type" varchar(50) NOT NULL,
  "event_type" varchar(50) DEFAULT NULL,
  "event_id" varchar(100) DEFAULT NULL,
  "content" text NOT NULL,
  "asset_log_created" timestamp(6) NOT NULL,
  "asset_log_updated" timestamp(6) NOT NULL,
  "VIN_id" varchar(100) NOT NULL,
  "created_by_id" int DEFAULT NULL,
  "location_id" int DEFAULT NULL,
  "modified_by_id" int DEFAULT NULL,
  PRIMARY KEY ("asset_log_id")
);

