-- Table structure for table "api_assetrequestfile"
--

DROP TABLE IF EXISTS "api_assetrequestfile" CASCADE;
CREATE TABLE "api_assetrequestfile" (
  "file_id" int NOT NULL GENERATED BY DEFAULT AS IDENTITY,
  "file_type" varchar(150) NOT NULL,
  "file_purpose" varchar(50) NOT NULL,
  "file_name" text NOT NULL,
  "file_url" text NOT NULL,
  "bytes" bigint NOT NULL,
  "date_created" timestamp(6) NOT NULL,
  "expiration_date" date DEFAULT NULL,
  "asset_request_id" int DEFAULT NULL,
  "created_by_id" int DEFAULT NULL,
  "vendor_id" int DEFAULT NULL,
  PRIMARY KEY ("file_id")
);

CREATE INDEX "api_assetrequestfile_asset_request_id_c29ec116_fk_api_asset" ON "api_assetrequestfile" ("asset_request_id");
CREATE INDEX "api_assetrequestfile_created_by_id_83520cc2_fk_api_detai" ON "api_assetrequestfile" ("created_by_id");
CREATE INDEX "api_assetrequestfile_vendor_id_725b6af9_fk_api_appro" ON "api_assetrequestfile" ("vendor_id");


